var NAVBAR_HEIGHT = 70;
var HEADER_HEIGHT = 100;
var FOOTER_DISTANCE = 20;
var windowHeight = Math.max(document.documentElement.clientHeight, window.innerHeight || 0);

$(function() {
  $(".TK-Hat")
    .on("mouseenter", ".TK-Hat-Menu-Item", function(e) {
      $(e.currentTarget).children(".TK-Dropdown").addClass("TK-Dropdown--Active");
    })
    .on("mouseleave", ".TK-Hat-Menu-Item", function(e) {
      $(e.currentTarget).children(".TK-Dropdown").removeClass("TK-Dropdown--Active");
    });
});

// floating nav
$(function() {
    function setScrollPosition() {
        var body = $(document.body);
        var scrollTop = body.scrollTop() || $('html').scrollTop();
        body
            .toggleClass("scroll", scrollTop > 0)
            .toggleClass("scroll-page", scrollTop > 630)
            .toggleClass("scroll-small-page", $(window).height() - scrollTop < $('.TK-Bar').height());
    }

    $(window).scroll(setScrollPosition);
    setScrollPosition();
});


function setSideNavPosition() {
    var $window = $(window);
    var windowHeight = $window.height();
    var scrollFold = $window.scrollTop() + windowHeight;
    var topNavigationHeight = $('nav.TK-Nav').height();

    if (window.screen.availWidth >= 768) {
        var top = window.scrollY > 0 ? topNavigationHeight - $('aside.TK-Hat').height() : topNavigationHeight;
        $('.sidefilter').css('top', top);
        $('.sidetoc').css('top', top + $('.sidefilter').outerHeight(true));
    }
    
    var footerHeight = $('#footer').outerHeight(true);
    var feedbackOffsetTop = document.body.scrollHeight - footerHeight;
    var bottom = Math.max(0, Math.min(footerHeight, scrollFold - feedbackOffsetTop));

    if (window.screen.availWidth < 768) {
        bottom = 0;
        if (!$('body.scroll').length) {
            top = HEADER_HEIGHT;
        }
    }

    var sideNavigation = $(".sidetoc");
    sideNavigation.css('bottom', bottom);
}

$(function () {
    $(window).scroll(setSideNavPosition)
        .resize(setSideNavPosition);
    $(document).ready(setSideNavPosition);
});

